script: |
  super -f text -I q9637.spq | sort > q9637.out

inputs:
  - name: q9637.spq
    data: |
      SELECT DISTINCT - ( COUNT ( * ) ) * COUNT ( * ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE NOT ( NULL ) IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q9637.out
    data: |
      -81
